import React from 'react';
import logo from './logo.svg';
import MuiThemeProvider from '@material-ui/core/styles/MuiThemeProvider';
import { createMuiTheme } from '@material-ui/core/styles';
import './App.css';
import SSOLoginComp from './components/login/SSOLoginComp'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import {jwtToken} from '../../client';


const theme = createMuiTheme({
  palette: {
    primary:{
      main: '#FFFFFF',
    }
  },
});

function App() {
  return (
  	<Router>
    <div className="App">
      <header className="App-header">
      	<MuiThemeProvider theme={theme}>
        	<SSOLoginComp/>
        </MuiThemeProvider>
      </header>

    <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>

  );
}

export default App;
